import {useState, useEffect} from 'react'
import './style/HomePage.css'
import Slider from './Slider'

function Home(){
  const [list, setList] = useState([])

  useEffect(() => {
    fetch("http://localhost:5001/api")
    .then(response => response.json())
    .then(list => setList(list))
  })

  return(
    <>
      <main>
          {
            list.map(item => (
              <div>
                <Slider data={item[3]}/>

              </div>
            ))
          }
      </main>
    </>
  )

}

export default Home;
